        try
            newPrompts = extract_chat_prompts(jsonPath);
            prompts = newPrompts; %#ok<NASGU>
            applyFilter(searchField.Value);
        catch err
            uialert(fig,err.message,'Reload failed','Icon','error');
        end
    end

